	    mtc0    $t4, $12


        sub $sp, $sp, 4
        sw $ra 0($sp)

        sw $0,  ANGLE
        li $t0, 1
        sw $t0, ANGLE_CONTROL

        li $a0,  116
        li $a1,  116

        jal move_direct

wait_1:
        lw  $t0, VELOCITY
        bne $t0, $0, wait_1

#         li $a0,  100
