#         bne $t0, $0, wait_3




while_not_done:
        jal go_to_next_kernel

wait_2:
        lw  $t0, VELOCITY
        bne $t0, $0, wait_2
        j   while_not_done

        lw $ra 0($sp)
        add $sp, $sp, 4

        j infinite

        jr $ra

# void move(x, y) {
#     deltax = abs(curx - x)
#     deltay = abs(cury - y)
#     angle = atan(deltay, deltax)
#     if curx - x < 0 and cury - y > 0:
#         angle *= -1
#     if curx - x > 0 and cury - y > 0:
#         angle = -180 + angle
#     if curx - x > 0 and cury - y < 0:
#         angle = 180 - angle
# 
#     SET RELATIVE ANGLE TO angle
# 
#     dist = sqrt(deltax * deltax + detlay * deltay)
# }
move_direct:
        sub     $sp,   $sp,   12
        sw      $s0,   0($sp)
        sw      $s1,   4($sp)
        sw      $ra,   8($sp)

        sw $0,  ANGLE
        li $t0, 1
        sw $t0, ANGLE_CONTROL

        lw      $s0,   BOT_X
        sub     $s0,   $s0,   $a0       # s0 = curx - x

        lw      $s1,   BOT_Y
        sub     $s1,   $s1,   $a1       # s1 = cury - y

        move    $a0,   $s0
        jal     abs_val
        move    $a1,   $v0

        move    $a0,   $s1
        jal     abs_val
        move    $a0,   $v0

        add     $a2,   $a0,  $a1
        ble     $a2,   4,    finish_moving

        jal     atan                    # v0 = atan

if_quad_1:
        bgt     $s0,   $0,    if_quad_2
        blt     $s1,   $0,    if_quad_2
        mul     $v0,   $v0,   -1
        j       set_rel_angle

if_quad_2:
        blt     $s0,   $0,    if_quad_3
        blt     $s1,   $0,    if_quad_3
        add     $v0,   $v0,   -180
        j       set_rel_angle

if_quad_3:
        blt     $s0,   $0,    set_rel_angle
        bgt     $s1,   $0,    set_rel_angle
        mul     $v0,   $v0,   -1
        add     $v0,   $v0,   180

set_rel_angle:
        sw      $v0,   ANGLE
        sw      $0,    ANGLE_CONTROL

        move    $a0,   $s0
        move    $a1,   $s1
        jal     pythag                  # v0 = total distance
        mul     $v0,   $v0,   1000
        lw      $t0,   TIMER
        add     $v0,   $v0,   $t0
        sw      $v0,   TIMER

        li      $s0,   10
        sw      $s0,   VELOCITY

finish_moving:
        lw      $s0,   0($sp)
        lw      $s1,   4($sp)
        lw      $ra,   8($sp)
        add     $sp,   $sp,   12

        jr      $ra

abs_val:
        bge     $a0,   $0,     end_abs
        mul     $a0,   $a0,   -1
end_abs:
        move    $v0,   $a0
        jr      $ra

# Find the diagonal of a triangle
pythag:
        mul     $a0,   $a0,   $a0
        mul     $a1,   $a1,   $a1
        add     $v0,   $a1,   $a0

        bne     $v0,   $zero, find_root
        bne     $v0,   1,     find_root
        jr      $ra

find_root:
        li      $a0,   1                             # i = 1
        li      $a1,   1                             # result = 1

while:
        bgt     $a1,   $v0,   done_py

        add     $a0,   $a0,   1
        mul     $a1,   $a0,   $a0

        j while

done_py:
        sub     $v0,   $a0,   1
        jr      $ra

# a0: Abs change in y
# a1: Abs change in x
atan:
        la      $v0,   board_width
        la      $t0,   atan_table
        lw      $v0,   0($v0)           # v0 = board_width
        add     $v0,   $v0,   1
        mul     $a0,   $a0,   $v0       # a0 = y * board_width
        add     $a0,   $a0,   $a1       # a0 = y * board_width + x
        mul     $a0,   $a0,   4
        add     $a0,   $a0,   $t0
        lw      $v0,   0($a0) 
        jr      $ra

#Fill in your code here
go_to_next_kernel:
        sub     $sp,  $sp,  16
        sw      $ra,  0($sp)
        sw      $s0,  4($sp)
        sw      $s1,  8($sp)
        sw      $s2,  12($sp)

        la      $t5,  heap
        sw      $t5, GET_KERNEL_LOCATIONS

        li      $t1,  25                # Upper x bound inclusive
        li      $t2,  7                 # Lower y bound inclusive
        li      $t3,  33                # Upper y bound inclusive

        lw      $s0,  BOT_X             # s0 = best x
        lw      $s1,  BOT_Y             # s1 = best y
        li      $s2,  900000            # s2 = best distance

search_map_outer:
        li      $t0,  15                # Lower x bound inclusive
        bgt     $t2,  $t3,  end_search

search_map_inner:
        bgt      $t0,  $t1,  end_map_outter 

        mul     $t4,  $t2,  40
        add     $t4,  $t4,  $t0
        add     $t4,  $t4,  4
        add     $t4,  $t4,  $t5         # t4 points to current map cell

        lb      $t6,  0($t4)
        ble     $t6,  $0,   end_map_inner

        mul     $a0,  $t0,  8
        mul     $a1,  $t2,  8
        lw      $a2,  BOT_X             # s0 = best x
        lw      $a3,  BOT_Y             # s1 = best y
        sub     $a0,  $a0,  $a2
        sub     $a1,  $a1,  $a3
        
        jal     pythag
        bge     $v0,  $s2,  end_map_inner
        ble     $v0,  8,    end_map_inner  # DON'T go for corn within 8 pixels of us. If it's too close, we get issues with scheduling interrupts.
        mul     $s0,  $t0,  8
        mul     $s1,  $t2,  8
        add     $s0,  $s0,  4
        add     $s1,  $s1,  4
        move    $s2,  $v0

end_map_inner:
        add     $t0,  $t0,  1
        j search_map_inner

end_map_outter:
        add     $t2,  $t2,  1        
        j       search_map_outer

end_search:
        move    $a0,  $s0
        move    $a1,  $s1
        jal     move_direct

        lw      $ra,  0($sp)
        lw      $s0,  4($sp)
        lw      $s1,  8($sp)
        lw      $s2,  12($sp)
        add     $sp,  $sp,  16
        jr      $ra

infinite:
        j       infinite              # Don't remove this! If this is removed, then your code will not be graded!!!

.kdata
chunkIH:    .space 8  #TODO: Decrease this
non_intrpt_str:    .asciiz "Non-interrupt exception\n"
unhandled_str:    .asciiz "Unhandled interrupt type\n"
.ktext 0x80000180
interrupt_handler:
.set noat
        move      $k1, $at              # Save $at
.set at
        la      $k0, chunkIH
        sw      $a0, 0($k0)             # Get some free registers
        sw      $v0, 4($k0)             # by storing them to a global variable

        mfc0    $k0, $13                # Get Cause register
        srl     $a0, $k0, 2
        and     $a0, $a0, 0xf           # ExcCode field
        bne     $a0, 0, non_intrpt

interrupt_dispatch:                     # Interrupt:
        mfc0    $k0, $13                # Get Cause register, again
        beq     $k0, 0, done            # handled all outstanding interrupts

        and     $a0, $k0, BONK_INT_MASK # is there a bonk interrupt?
        bne     $a0, 0, bonk_interrupt

        and     $a0, $k0, TIMER_INT_MASK # is there a timer interrupt?
        bne     $a0, 0, timer_interrupt

        and 	$a0, $k0, REQUEST_PUZZLE_INT_MASK
        bne 	$a0, 0, request_puzzle_interrupt

        li      $v0, PRINT_STRING       # Unhandled interrupt types
        la      $a0, unhandled_str
        syscall
        j       done

bonk_interrupt:
        sw      $0, BONK_ACK
#Fill in your code here
        j       interrupt_dispatch      # see if other interrupts are waiting

request_puzzle_interrupt:
        sw      $0, REQUEST_PUZZLE_ACK
#Fill in your code here
        j	interrupt_dispatch

timer_interrupt:
        sw      $0, TIMER_ACK
        sw      $0, VELOCITY
        li      $k0, 1
        sw      $k0, PICKUP




#Fill in your code here
        j   interrupt_dispatch
non_intrpt:                             # was some non-interrupt
        li      $v0, PRINT_STRING
        la      $a0, non_intrpt_str
        syscall                         # print out an error message
# fall through to done

done:
        la      $k0, chunkIH
        lw      $a0, 0($k0)             # Restore saved registers
        lw      $v0, 4($k0)

.set noat
        move    $at, $k1                # Restore $at
.set at
        eret